import Navbar from "./instructor-navbar.component";
import InstructorLogin from "./instructor-login.component";
import CreateInstructorAccount from "./instructor-create-account.component";

function Student() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/login" component = {InstructorLogin} />
        <Route path="/student/create" component = {CreateInstructorAccount} />
      </div>
    </Router>
  );
}

export default Instructor;
